  and cartographic information from the 1998 TIGER/Line files detailing railroads.
  This dataset includes railroad tracks, railroad main lines, railroad spurs, railroad
  yards, railroad ferry crossings, car lines, and cog railroads. CUGIR, The Cornell
  University Geospatial Information Repository, using US Department of Commerce, Bureau
  of the Census data, developed the GIS data set versions of 1998 Census TIGER/Line
  files for 10 coverages for each of the 62 counties in New York State.\",\n\t\"license_title\":
